	add("creation", "{\"term\":\"creation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027creacion\u0027 (French \u0027création\u0027 , from Latin {{m|la|creātiō}}, \u0027creationis\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something created such as an invention or artwork\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I think the manufacturer was so ashamed of its \u0027\u0027creation\u0027\u0027 that it didn\u0027t put its name on it\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The act of creating something\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The restructure resulted in the \u0027\u0027creation\u0027\u0027 of a number of shared services\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"All which exists\u0026lt;!-- biblical / philosophical sense? --\u0026gt\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Let us pray to Christ, the King of all \u0027\u0027creation\", \"priority\":6}]}, \"synonyms\":{}}");

	add("creationism", "{\"term\":\"creationism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|creation|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The Abrahamic doctrine that each individual human soul is created by God, as opposed to traducianism\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any creationary belief, especially a belief that the origin of things is due to an event or process of creation brought about by the deliberate act of any divine agency, such as a Creator God (creator god\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The belief that a deity created the world, especially as described in a particular religious text, such as the Quran or the Book of Genesis\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Thomas Dixon, \u0027Science and Religion: A Very Short Introduction\u0027, [http://books.google.co.uk/books?id\u003dqpT3QAVZ9nsC\u0026amp;pg\u003dPT137\u0026amp;dq\u003d%22 link\", \"priority\":4}]}, \"synonyms\":{}}");

	add("creator", "{\"term\":\"creator\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman {{m|fro|creatour}}, from Old french (842-ca. 1400) {{m|fro|creator}}, from Latin {{m|la|creātor}}, agent noun from perfect passive participle \u0027creātus\u0027 (created) from verb \u0027creō\u0027 (i create) + agent suffix {{m|la|-or}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something or someone which creates or makes something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Kenneth E. Iverson was the \u0027\u0027creator\u0027\u0027 of APL\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The deity that created the world\", \"priority\":3}]}, \"synonyms\":{}}");

	add("creature", "{\"term\":\"creature\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\"], \"text\":\"Existing since Middle english (1100-1500) in the original sense of “a created thing”, borrowed via Old french (842-ca. 1400) from {{m|la|creatura}}, from {{m|la|creare}}.\u0026lt;ref name\u003d\u0026quot;COED-etym\u0026quot;\u0026gt;The \u0027\u0027Concise Oxford English Dictionary\u0027\u0027 [Eleventh Edition]\u0026lt;/ref\u0026gt; Displaced native Old english (ca. 450-1100) \u0027gesceap\u0027 (creature)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A created thing, whether animate or inanimate; a creation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1633\u0027\u0027, \u0026quot;Sapho to Philænis\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Thoughts, my mindes \u0027\u0027creatures\u0027\u0027, often are with thee, / But I, their maker, want their libertie\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1646\u0027\u0027, \u0027Pseudodoxia Epidemica\u0027, I.10\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"the natural truth of God is an artificial erection of Man, and the Creator himself but a subtile invention of the \u0027\u0027Creature\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d1|url\u003dhttp://openlibrary.org/works/OL1521052W|passage\u003dShe was like a Beardsley \u0027Salome\u0027, he had said. And indeed she had the narrow eyes and the high cheekbone of that \u0027\u0027creature\u0027\u0027, and as nearly the sinuosity as is compatible with human symmetry\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A living being; an animal or human\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/business/21579011-president-proposes-new-round-intellectual-property-reform-obama-goes-troll-hunting Obama goes passage\u003dAccording to this saga of intellectual-property misanthropy, these \u0027\u0027creatures\u0027\u0027 [patent trolls] roam the business world, buying up patents and then using them to demand extravagant payouts from companies they accuse of infringing them. Often, their victims pay up rather than face the costs of a legal battle\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A being subservient to or dependent upon another\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, James McPherson, \u0027Battle Cry for Freedom\u0027, Oxford 2003, p. 240\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"they, too, despite the appearance of being \u0027\u0027creatures\u0027\u0027 rather than creators of the Union, could assert the prior sovereignty of their states, for each had formed a state constitution […] \u0027before\u0027 petitioning Congress for admission to the Union\", \"priority\":11}]}, \"synonyms\":{}}");

	add("credo", "{\"term\":\"credo\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|crēdō||I believe}}; see \u0027creed\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A belief system\", \"priority\":1}]}, \"synonyms\":{}}");

