	add("credibility", "{\"term\":\"credibility\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From the French \u0027crédibilité\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Reputation impacting one\u0027s ability to be believed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"After weeks of blowing smoke, her credibility with me was next to nil\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Believability of statements by a witness, as measured by whether the testimony is probable or improbable when judged by common experience\", \"priority\":3}]}, \"synonyms\":{}}");

